		window.addEventListener('orientationchange',

												updateBg(); },
								false);

		function updateBg() {
			var body = document.body, ad = document.getElementById("bg"),
				link = document.getElementById('link') || ad,
				height = document.documentElement.clientHeight,
				width = document.documentElement.clientWidth,
				adheight = ad.naturalHeight ? ad.naturalHeight : ad.offsetHeight,
				adwidth = ad.naturalWidth ? ad.naturalWidth : ad.offsetWidth;

			ad.style.maxHeight = "100%";
			ad.style.maxWidth = "100%";
			body.style.height = height + 'px';
			body.style.width = width + 'px';
			link.style.top = 'auto';

			var hr = adheight / height, wr = adwidth / width;
			if(hr > wr) {
				ad.style.height = height + 'px';
				ad.style.width = 'auto';
			} else {
				ad.style.height = 'auto';
				ad.style.width = width + 'px';
				link.style.top = (height - ad.offsetHeight) / 2 + 'px';
			}
		}
	</script>
